    repeated Ethregistrar_NameRegistered ethregistrar_name_registereds = 14;
    repeated Ethregistrar_NameRenewed ethregistrar_name_reneweds = 15;
    repeated Ethregistrar_OwnershipTransferred ethregistrar_ownership_transferreds = 16;
