    repeated Namewrapper_TransferBatch namewrapper_transfer_batches = 25;
    repeated Namewrapper_TransferSingle namewrapper_transfer_singles = 26;
    repeated Namewrapper_Uri namewrapper_uris = 27;
    repeated Dnsregistrar_Claim dnsregistrar_claims = 28;
    repeated Dnsregistrar_NewPublicSuffixList dnsregistrar_new_public_suffix_lists = 29;
